function read(){
  return fetch("./pageStructure.json", {
    method: 'GET',
    headers: {
      'Content-Type': 'application/json',
      Accept: "application/json"
    }
  }).then(response => {
    return response.json();
  });
}

async function getPageStructure(){
  const pageStructure = await read();
  return pageStructure;
}

function PageLoader() {
  const pageStructure = getPageStructure();
  console.log(pageStructure);
  return (
    <div>{pageStructure["id"]}</div>
  );
}

export default PageLoader;
